(function ($) {
    var jQuery = $;
	$(document).ready(function () {
		$('.main .mcon04 .pd_cont ul li .info-box .product_price').each(function(){
			var pricetxt = $(this).text();
			console.log(pricetxt);
			if(pricetxt == '0'){
				$(this).text('0won');
			}
			
		});
	});
	$(function(){
		//메인비쥬얼
		var mcon01Slider = new Swiper(".mcon01 .swiper-container", {
			pagination: {
			  el: ".mcon01 .swiper-pagination",
			  type: "fraction",
			},	
			//loop:true,
			navigation: {
			  nextEl: ".mcon01 .swiper-button-next",
			  prevEl: ".mcon01 .swiper-button-prev",
			},
			observer: true,
			observeParents: true,
			/*스와이퍼가 작동했을때 클래스(애니매이션효과등)적용하기*/
			on : {
			slideChangeTransitionStart : function(){
					if (this.activeIndex == 1){
						$(".mcon01 .swiper-container").addClass("two");
						$(".mcon01 .swiper-container").removeClass("three");
					} else if(this.activeIndex == 2){
						$(".mcon01 .swiper-container").addClass("three");
						$(".mcon01 .swiper-container").removeClass("two");
					}else if(this.activeIndex == 0){
						$(".mcon01 .swiper-container").removeClass("three");
						$(".mcon01 .swiper-container").removeClass("two");
					}
		 		}
			},	
		});
		//gif영역
		//var mcon03Slider = new Swiper(".mcon03 .swiper-container", {
