		//	observer: true,
		//	observeParents: true,	  
		//});

		//토보코 컬렉션
		var mcon04Slider = new Swiper(".mcon04 .swiper-container", {
			slidesPerView : '3',	
			spaceBetween: 100,
			pagination: {
			   el: ".mcon04 .swiper-pagination",
				type: "progressbar",
			},	
			navigation: {
			  nextEl: ".mcon04 .swiper-button-next",
			  prevEl: ".mcon04 .swiper-button-prev",
			},
			observer: true,
			observeParents: true,	
			breakpoints: {
				// 화면의 넓이가 1200px 이상일 때 
				1024: { 
					slidesPerView: 1.5,
					spaceBetween: 20,	
					centeredSlides: true,
				}
			}	  
		});

		$('.prdList li').each(function () {
			if ($(this).find('.custom_price').text() != '') {
				var getDefault = $(this).find('.custom_price').data('default');
				var getCustom = $(this).find('.custom_price').data('custom');
				/*var calc = getDefault * 100 / getCustom;*/
				var calc =  (1-(getDefault/getCustom))*100;
				if(getDefault < getCustom) {
				  $(this).find('.product_price').before(' <span class="discount-rate">' + Math.round(calc) + '<span class="per">%<span></span>')
				} else {
				  $(this).find('.custom_price').hide();
				}
			}
		});
