(function ($) {
    var jQuery = $;
	var $cate = '';
	$.ajax({
		url: '/exec/front/Product/SubCategory',
		dataType : 'json',
		success: function(data) {
			// name,param,cate_no,parent_cate_no,design_page_url
			$.each(data, function(m,key) {
				// 1차 카테고리
				if(key.parent_cate_no=='1'){
					$cate += '<li class="cate-grade-one relative"><p><a href="javascript:;" class="menu_x"><img src="https://tocobo.cafe24.com/wib/img/mo/icon/slide_menu_arrow.png" alt="서브메뉴화살표" /></a><a href="/product/list.html' + key.param +'">'+ key.name +'</a></p>';
					//$cate += '<span class="toggle"></span>'
					$cate += '  <ul class="sub-category cate-grade-two-wrap easing-three">';
					$.each(data, function(n,sub) {
						// 2차 카테고리
						if( key.cate_no == sub.parent_cate_no ){
							$cate += '<li class="cate-grade-two relative"><a class="easing-one" href="/product/list.html' + sub.param +'">'+ sub.name +'</a>';
							//$cate += '<span class="toggle"></span>'
							$cate += '  <ul class="cate-grade-three-wrap easing-three">';
							$.each(data, function(o,child) {
								// 3차 카테고리
								if( sub.cate_no == child.parent_cate_no ){
									$cate += '<li class="cate-grade-three relative"><a class="easing-one" href="/product/list.html' + child.param +'">'+ child.name +'</a>';
									//$cate += '<span class="toggle"></span>'
									$cate += '  <ul class="cate-grade-four-wrap easing-three">';
									$.each(data, function(p,last) {
										// 4차 카테고리
										if( child.cate_no == last.parent_cate_no ){
											$cate += '<li class="cate-grade-four"><a class="easing-one" href="/product/list.html' + last.param +'">'+ last.name +'</a></li>';  
											//$cate += '<span class="toggle"></span>'
										}
								});
								$cate += '  </ul>';
								$cate += '</li>';   
								};
							});    
							$cate += '  </ul>';
							$cate += '</li>';
						};
					});
					$cate += '  </ul>';
					$cate += '</li>';
				};
			});

			// 카테고리 삽입하려는 선택자 선택
			$('.side-pd .p_sub').prepend($cate);

			//2차 메뉴 버튼
			if($(".s-sub-menu>li").find(".sub-category>li").hasClass("cate-grade-two")==true){
				$(".cate-grade-two").parent("ul").parent("li").children(".toggle").show();
			}
			$(".side-pd .title").click(function(){
				$(this).next('.sub_m').addClass("on");
				$("body").addClass("oHidden");
			});
			$('.menu_x').click(function(){
				$('.sub_m').removeClass("on");
				$("body").removeClass("oHidden");
			});
			
		}
	});
})(addjQuery);
